# logic: linked list would be an exact implementation of the problem as adding at the middles linked lists are the best
# first check the before possibility and then move to see if can fit to next using while

class MyCalendar:
    def __init__(self):
        self.calendar=[]

    def book(self, start, end):
        # print(self.calendar)
        end-=1

        len_cal = len(self.calendar)
        # if empty then just push it

        if len_cal==0:
            self.calendar.append([start, end])
            return True
        # see if fits at start
        elif start <= self.calendar[0][0]:

            if start==self.calendar[0][0]:
                return False
            elif end+1 == self.calendar[0][0]:
                self.calendar[0][0] = start
            elif end >= self.calendar[0][0]:
                return False
            else:
                self.calendar.insert(0, [start, end])
            return True
        # else repeat in loop to see if fits to the only next of current element

        else:
            # make sure that doesn't overlap with the current and then see if is between the two ranges
            i=0
            while i < len_cal:
                # check for overlap
                if self.calendar[i][0] <= start <= self.calendar[i][1]:
                    return False
                elif i < len_cal-1:
                    if start > self.calendar[i+1][0]:
                        i+=1
                        continue
                    if not (start > self.calendar[i][1] and end < self.calendar[i+1][0]):
                        return False
                    if start-1 == self.calendar[i][1]:
                        if end+1 == self.calendar[i+1][0]:
                            self.calendar[i][1] = self.calendar[i + 1][1]
                            del self.calendar[i + 1]
                        else:
                            self.calendar[i][1] = end
                        # return True
                    elif end +1 == self.calendar[i+1][0]:
                        self.calendar[i+1][0]=start
                        # return True
                        # add and return true
                    else:
                        self.calendar.insert(i+1, [start, end])
                    return True
                elif self.calendar[i][1]+1==start: # in last position so need to check start and then return
                    self.calendar[i][1] = end
                    # return True
                else:
                    self.calendar.append([start, end])
                return True


